import React from 'react';
import ReactDOM from 'react-dom';
import './Contributors.css';

function Contributors() {
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Contributors
                </p>
            </header>
            
            <div className="Contributor-Name">
            <p>
            Contributor 1
            <br></br>
            </p>
                
            </div>
        </div>
        

    );
}

export default Contributors;
